@app.route('/api/stocks/page', methods=['GET'])
def api_all():
    result = []
    if 'number' in request.args:
        pageNum = int(request.args['number'])
    else:
        pageNum = 1
    if 'length' in request.args and 0 < int(request.args['length']) < (len(stocks) + 1):
        numPerPage = int(request.args['length'])
    else:
        numPerPage = 15

    threads = []
    with ThreadPoolExecutor(max_workers=100) as executor:
        for i in range(0, numPerPage):
            threads.append(executor.submit(currentStockPrices, stocks[(numPerPage*(pageNum - 1))+i]['name'], (numPerPage*(pageNum - 1))+i))

        for task in as_completed(threads):
            vals = task.result()
            print(vals)
            stocks[vals[2]]["currentPrice"] = vals[0]
            stocks[vals[2]]["afterhoursPrice"] = vals[1]
            result.append(stocks[vals[2]])
    jsonResult = jsonify(result)
    jsonResult.headers.add("Access-Control-Allow-Origin", "*")
    return jsonResult

@app.route('/api/stocks/list', methods=['GET'])
def api_list():
    result = []
    temp = {}
    if 'names' in request.args:
        print(request.args['names'].split(','))
        if request.args['names'] == "null":
            temp["name"] = 'none'
            temp["currentPrice"] = "0"
            temp["afterhoursPrice"] = "0"
            result.append(temp)
            jsonResult = jsonify(result)
            jsonResult.headers.add("Access-Control-Allow-Origin", "*")
            return jsonResult
        else:
            names = request.args['names'].split(',')
    threads = []
    with ThreadPoolExecutor(max_workers=100) as executor:
        for i in names:
            stockIndex = findStockIndex(stockList, i)
            threads.append(executor.submit(currentStockPrices, stocks[stockIndex]['name'], stockIndex))
        for task in as_completed(threads):
            vals = task.result()
            stocks[vals[2]]["currentPrice"] = vals[0]
            stocks[vals[2]]["afterhoursPrice"] = vals[1]
            result.append(stocks[vals[2]])
    jsonResult = jsonify(result)
    jsonResult.headers.add("Access-Control-Allow-Origin", "*")
    return jsonResult


@app.route('/api/stocks', methods=['GET'])
def api_name():
    if 'name' in request.args:
        name = str(request.args['name'])
    else:
        return "Error: No id field provided. Please specify an id."
    results = []
    for stock in stocks:
        if stock['name'].upper() == name.upper():
            prices = currentStockPrices(stock['name'])
            stock["currentPrice"] = prices[0]
            stock["afterhoursPrice"] = prices[1]
            results.append(stock)
    jsonResult = jsonify(results)
    jsonResult.headers.add("Access-Control-Allow-Origin", "*")
    return jsonResult

app.run()